import React, { Component } from 'react';
import { Carousel } from 'antd';
import 'antd/dist/antd.css';


class Header extends Component {
    render() { 
        return(
            <>
            <Carousel className="zone">
                <div>
                <h3 className="contentStyle pic1">1</h3>
                </div>
                <div>
                <h3 className="contentStyle pic2">2</h3>
                </div>
                <div>
                <h3 className="contentStyle pic3">3</h3>
                </div>
                <div>
                <h3 className="contentStyle pic4">4</h3>
                </div>
            </Carousel>
            </>
        );
    }
}

export default Header;
